    false,nt"url": null,nt"notes": "The purpose of this plan is to establish
    guidelines for the cooperative management of the Western Population (WP) of tundra
    swans (Cygnus c. columbianus). This document is a revision of the original flyway
    management plan for this population (Pacific Flyway Council 1983). It also incorporates
    revised provisions for harvest management that were formerly found in the separate
    1989 Hunt Plan (Pacific Flyway Council 1989). Management of Eastern Population (EP)
    tundra swans, which migrates from northern Alaska across all four waterfowl flyways,
    is treated in a separate continental plan (Ad Hoc Eastern Population Tundra Swan
    Committee 1998).",nt"license_title": "License Not Specified",nt"extras":
